import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

// Create Root React Element

const root = ReactDOM.createRoot(document.getElementById("root"));

// Render App element to the Root.
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
